import book_sugget from"/js/src/dynamic-template.json"with{type:"json"};function asthetic_template_crawler(e){let t="";for(let l of e.template)for(let e of l.asthetic_template)t+=` <div class="ms-2"><a target="_blank" href="${e.template_link}">\n                                    <img loading="lazy" src="${e.template_image}"\n                                        alt="${e.image_alt}">\n                                </a>\n                            </div>`;return t}function colourfull_template_crawler(e){let t="";for(let l of e.template)for(let e of l.colourfull_template)t+=` <div class="ms-2"><a target="_blank" href="${e.template_link}">\n                                    <img loading="lazy" src="${e.template_image}"\n                                        alt="${e.image_alt}">\n                                </a>\n                            </div>`;return t}let asthe_loader=document.getElementById("asthe");asthe_loader.addEventListener("click",()=>{asthe_loader.classList.add("invisible"),document.querySelector("#asthetic-template").insertAdjacentHTML("beforeend",asthetic_template_crawler(book_sugget))});let colorf_loader=document.getElementById("colorf");colorf_loader.addEventListener("click",()=>{colorf_loader.classList.add("invisible"),document.querySelector("#colourfull-templates").insertAdjacentHTML("beforeend",colourfull_template_crawler(book_sugget))});